import React from 'react'
import Header from '../../Components/Header/Header';
import { Outlet } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

const Home = () => {

  const navigate = useNavigate()

  const handleSubmit = () => {
    navigate('search')
  }

  return (
    <main>
      <Header />
      <Outlet />
      <form></form>
      <button onClick={handleSubmit}>
        click me
      </button>
    </main>

  )
}

export default Home
